import React from 'react';
import {Link} from "react-router-dom";

function Events(props) {

    const Dummy_Events = [
        {id:'e1', title: 'event01'},
        {id:'e2', title: 'event02'},
        {id:'e3', title: 'event03'},
        {id:'e4', title: 'event04'}
    ]


    return (
        <>
            <h1>Events page</h1>
            {Dummy_Events.map((event) => (
                    <li key={event.id}><Link to={event.id}> {event.title}</Link> </li>
            )
            )}
        </>
    );
}

export default Events;
